function Particle(e,point, velocity, acceleration,home) {
  this.position = point || new Vector(0, 0);
  this.velocity = velocity || new Vector(0, 0);
  this.acceleration = acceleration || new Vector(0, 0);
  this.home = home||new Vector(this.position.x,this.position.y);
  this.dest = e.dest;
  this.position.add(this.velocity.mult(2));
  this.emitter = e;
}

Particle.prototype.submitToFields = function(fields) {
  // our starting acceleration this frame
  var totalAccelerationX = 0;
  var totalAccelerationY = 0;

  // for each passed field
  for (var i = 0; i < fields.length; i++) {
    var field = fields[i];

    // find the distance between the particle and the field
    var vectorX = field.position.x - this.position.x;
    var vectorY = field.position.y - this.position.y;

    // calculate the force via MAGIC and HIGH SCHOOL SCIENCE!
    var force = field.mass / Math.pow(vectorX * vectorX + vectorY * vectorY, 1.5);

    // add to the total acceleration the force adjusted by distance
    totalAccelerationX += vectorX * force;
    totalAccelerationY += vectorY * force;
  }

  // update our particle's acceleration
  this.acceleration = new Vector(totalAccelerationX, totalAccelerationY);
};

Particle.prototype.move = function() {
  this.velocity.add(this.acceleration);
  this.position.add(this.velocity);
};

function Field(point, mass) {
  this.position = point;
  this.setMass(mass);
}

Field.prototype.setMass = function(mass) {
  this.mass = mass || 100;
  this.drawColor = mass < 0 ? "#f00" : "#0f0";
}

function Vector(x, y) {
  this.x = x || 0;
  this.y = y || 0;
}

Vector.prototype.add = function(vector) {
  this.x += vector.x;
  this.y += vector.y;
}
Vector.prototype.mult = function(num) {
  return new Vector(this.x*num,this.y*num);
}

Vector.prototype.getMagnitude = function() {
  return Math.sqrt(this.x * this.x + this.y * this.y);
};
Vector.prototype.setMagnitude = function(val) {
  var mag = this.getMagnitude();
  this.x=this.x*(val/mag);
  this.y=this.y*(val/mag);
};

Vector.prototype.getAngle = function() {
  return Math.atan2(this.y, this.x);
};
Vector.prototype.negate = function() {
  this.x *=-1;
  this.y*=-1;
};

Vector.fromAngle = function(angle, magnitude) {
  return new Vector(magnitude * Math.cos(angle), magnitude * Math.sin(angle));
};

function Emitter(point, velocity, spread,dest) {
  this.position = point; // Vector
  this.velocity = velocity; // Vector
  this.spread = 0; // possible angles = velocity +/- spread
  this.drawColor = "#999"; // So we can tell them apart from Fields later
  this.dest = dest||new Vector(canvas.width/2,canvas.height/2);
  this.peer = false;
}
Emitter.prototype.FindLocal = function() {
  var closeones = [];
  for(var i =0;i<emitters.length;i++){
    if(emitters[i]!=this){
      var calcdist = Math.sqrt((emitters[i].position.x-this.position.x)*(emitters[i].position.x-this.position.x)+(emitters[i].position.y-this.position.y)*(emitters[i].position.y-this.position.y));
      if(calcdist >10 && calcdist <200){
        closeones[closeones.length]=emitters[i];
      }
    }
  }
  if(closeones.length==0){
    console.log("alt");
    for(var i =0;i<emitters.length;i++){
      if(emitters[i]!=this){
        var calcdist = Math.sqrt((emitters[i].position.x-this.position.x)*(emitters[i].position.x-this.position.x)+(emitters[i].position.y-this.position.y)*(emitters[i].position.y-this.position.y));
        if(calcdist <500){
          closeones[closeones.length]=emitters[i];
        }
      }
    }
  }
  if(closeones.length!=0){
    var chosenEmitter = closeones[Math.round(Math.random()*(closeones.length-1))];
    var x = chosenEmitter.position.x;
    var y= chosenEmitter.position.y;
    var dx = (x-this.position.x)/Math.sqrt((x-this.position.x)*(x-this.position.x)+(y-this.position.y)*(y-this.position.y))*ejectionRate;
    var dy = (y-this.position.y)/Math.sqrt((x-this.position.x)*(x-this.position.x)+(y-this.position.y)*(y-this.position.y))*ejectionRate;
    this.velocity = new Vector(dx,dy);
    this.dest = chosenEmitter.position;
    this.peer = true;
  }
    
}
Emitter.prototype.emitParticle = function() {
  // Use an angle randomized over the spread so we have more of a "spray"
  var angle = this.velocity.getAngle() + this.spread - (Math.random() * this.spread * 2);

  // The magnitude of the emitter's velocity
  var magnitude = this.velocity.getMagnitude();

  // The emitter's position
  var position = new Vector(this.position.x, this.position.y);

  // New velocity based off of the calculated angle and magnitude
  var velocity = Vector.fromAngle(angle, magnitude);

  // return our new Particle!
  return new Particle(this,position, velocity);
};

function addNewParticles() {
  // if we're at our max, stop emitting.
  if (particles.length > maxParticles) return;

  // for each emitter
  

    // emit [emissionRate] particles and store them in our particles array
    for(var i= 0;i<emissionRate;i++)
      particles.push(emitters[Math.round(Math.random()*(emitters.length-1))].emitParticle());
}

function plotParticles(boundsX, boundsY) {
  // a new array to hold particles within our bounds
  var currentParticles = [];

  for (var i = 0; i < particles.length; i++) {
    if(currentParticles.length>maxParticles){
      particles = currentParticles;
      return;
    }
    var particle = particles[i];
    var pos = particle.position;

    // If we're out of bounds, drop this particle and move on to the next
    if (pos.x < 0 || pos.x > boundsX || pos.y < 0 || pos.y > boundsY) continue;
    if (pos.x < particle.home.x+2 && pos.x > particle.home.x-2 && pos.y < particle.home.y+2 && pos.y > particle.home.y-2) {
      if(p2p)particle.emitter.FindLocal();
      
      continue;
    }
    if (pos.x < particle.dest.x+5 && pos.x > particle.dest.x-5 && pos.y < particle.dest.y+5 && pos.y > particle.dest.y-5) {
      particle.velocity.negate();
      particle.acceleration.negate();
    }

    // Update velocities and accelerations to account for the fields
    particle.submitToFields(fields);

    // Move our particles
    particle.move();

    // Add this particle to the list of current particles
    currentParticles.push(particle);
  }

  // Update our global particles reference
  particles = currentParticles;
}

function drawParticles() {
  ctx.fillStyle = 'rgb(0,255,255)';
  for (var i = 0; i < particles.length; i++) {
    var position = particles[i].position;
    ctx.fillStyle = particles[i].emitter.peer?'rgb(255,255,50)':'rgb(0,255,255)';
    ctx.fillRect(position.x, position.y, particleSize, particleSize);
  }
}

function drawCircle(object) {
  ctx.fillStyle = 'rgb(0,0,255)';

  ctx.fillRect(object.position.x, object.position.y, objectSize, objectSize);
}

